  `taskId` bigint DEFAULT NULL COMMENT '任务ID',
  `status` tinyint NOT NULL DEFAULT '0' COMMENT '状态 0:失败 1：成功',
  `detail` text COMMENT '详情描述',
  PRIMARY KEY (`id`),
  KEY `IDX_b9af0e100be034924b270aab31` (`createTime`),
